import React from "react";
import { sum, sub, mult, division } from "./Calc";

const calcCss = {
  justifyContent: "center",
};

function Calculation() {
  return (
    <>
      <ol style={calcCss}>
        <h1>{sum(2, 4)}</h1>
        <h1>{sub(2, 4)}</h1>
        <h1>{mult(2, 5)}</h1>
        <h1>{division(2, 5)}</h1>
      </ol>
    </>
  );
}
export default Calculation;
